/************************

Custom fact tables

************************/

CREATE TABLE sb_fact
(
  fact_id					NUMBER(19)			NOT NULL,
  person_id					NUMBER(19)			NOT NULL,
  fact_concept_id			INTEGER			NOT NULL,
  fact_date					DATE			NOT NULL,
  fact_type_concept_id		INTEGER			NOT NULL,
  operator_concept_id		INTEGER			NULL,
  value_as_number			FLOAT			NULL,
  value_as_string			VARCHAR(1024)	NULL,
  value_as_date				DATE			NULL,
  value_as_concept_id		INTEGER			NULL,
  unit_concept_id			INTEGER			NULL,
  provider_id				INTEGER			NULL,
  visit_occurrence_id		INTEGER			NULL,
  comment					VARCHAR(1024)	NULL,
  fact_source_value			VARCHAR(50)		NULL,
  fact_source_concept_id	INTEGER			NULL,
  unit_source_value			VARCHAR(50)		NULL,
  value_source_value		VARCHAR(1024)	NULL
);

BEGIN
  EXECUTE IMMEDIATE 'CREATE UNIQUE INDEX pk_fact_id  ON sb_fact  (fact_id ASC)';
EXCEPTION
  WHEN OTHERS THEN
    IF SQLCODE != -1408 THEN
      RAISE;
    END IF;
END;
CREATE INDEX idx_fact_concept_id ON sb_fact (fact_concept_id);
CREATE INDEX idx_fact_person_id ON sb_fact (person_id);
CREATE INDEX idx_fact_value_string ON sb_fact (value_as_string);
CREATE INDEX idx_fact_value_date ON sb_fact (value_as_date);
CREATE INDEX idx_fact_value_concept_id ON sb_fact (value_as_concept_id);
CREATE INDEX idx_fact_visit_id ON sb_fact (visit_occurrence_id);


CREATE TABLE sb_fact_attribute
(
  fact_attribute_id					NUMBER(19)			NOT NULL,
  fk_fact_id						NUMBER(19)			NOT NULL,
  value_as_number					FLOAT			NULL,
  value_as_string					VARCHAR(1024)	NULL,
  value_as_date						DATE			NULL,
  value_as_concept_id				INTEGER			NULL,
  unit_concept_id					INTEGER			NULL,
  attribute_concept_id				INTEGER			NULL,
  comment							VARCHAR(1024)	NULL,
  fact_attribute_source_value		VARCHAR(50)		NULL,
  fact_attribute_source_concept_id	INTEGER			NULL,
  fact_attribute_unit_source_value	VARCHAR(50)		NULL,
  fact_attribute_value_source_value	VARCHAR(1024)	NULL
);

BEGIN
  EXECUTE IMMEDIATE 'CREATE UNIQUE INDEX pk_fact_attribute_id  ON sb_fact_attribute  (fact_attribute_id ASC)';
EXCEPTION
  WHEN OTHERS THEN
    IF SQLCODE != -1408 THEN
      RAISE;
    END IF;
END;
CREATE INDEX idx_fact_attr_fact_id ON sb_fact_attribute (fk_fact_id);
CREATE INDEX idx_fact_attr_value_string ON sb_fact_attribute (value_as_string);
CREATE INDEX idx_fact_attr_value_date ON sb_fact_attribute (value_as_date);
CREATE INDEX idx_fact_attr_value_concept_id ON sb_fact_attribute (value_as_concept_id);

